import React from 'react';
import './Page.css'; // Import CSS for styling if needed
import img from './Image/m1.jpeg';


function Page() {
  return (
    
    <div className="page-container">
      <img src={img} alt='machine'/>
      <h1>The machine of 1kvar</h1>
      <hr></hr>
      <span ><p>This is the page you navigated to from the card helps to solve your query.</p> </span>
    </div>
  );
}

export default Page;
